    false,nt"url": null,nt"notes": "This indicator shows how reported Lyme
    disease incidence has changed by state since 1991, based on the number of new cases
    per 100,000 people. The total change has been estimated from the average annual
    rate of change in each state. This map is limited to the 14 states where Lyme disease
    is most common, where annual rates are consistently above 10 cases per 100,000.
    Connecticut, New York, and Rhode Island had too much year-to-year variation in reporting
    practices to allow trend calculation. For more information: www.epa.gov/climatechange/science/indicators",nt"license_title":
